/** @jsxImportSource @emotion/react */
import React from 'react';
import { motion } from 'framer-motion';

interface ServiceItem {
  title: string;
  description: string;
  icon: string;
  features: string[];
  price: string;
  priceLabel: string;
}

const services: ServiceItem[] = [
  {
    title: 'Background Magic',
    description: 'Transport your child to magical worlds! We can place them in enchanted castles, mystical forests, outer space, or tropical beaches. Our AI technology seamlessly removes unwanted objects and creates stunning backdrops that look natural and professional.',
    icon: 'âœ¨',
    features: [
      'Good natural lighting',
      'Clear view of the child',
      'Simple background preferred',
      'Higher resolution photos'
    ],
    price: '29 zÅ‚',
    priceLabel: 'PER PHOTO'
  },
  {
    title: 'Fantasy Characters',
    description: 'Transform your child into their favorite characters! From superheroes and fairies to knights and astronauts, we can create stunning transformations that bring their imagination to life. We add realistic costumes, props, and magical effects to make the transformation look natural and amazing.',
    icon: 'ðŸ‘¤',
    features: [
      'Full body or upper body shots',
      'Clear view of face and pose',
      'Good lighting on the subject',
      'Neutral background preferred'
    ],
    price: '69 zÅ‚',
    priceLabel: 'PER PHOTO'
  },
  {
    title: '3D Printed Characters',
    description: 'Turn your child\'s photo into a unique 3D printed figurine! We create detailed, personalized 3D models that capture their likeness and personality. Perfect for special occasions, gifts, or as a unique keepsake.',
    icon: 'ðŸŽ¨',
    features: [
      'Front-facing portrait',
      'Good lighting on all sides',
      'Neutral expression',
      'High resolution photo'
    ],
    price: '59 zÅ‚',
    priceLabel: 'PER MODEL'
  }
];

const Services: React.FC = () => {
  return (
    <div className="services-section">
      <div className="services-container">
        <motion.div
          className="services-header"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
        >
          <h2>Our Services</h2>
          <p>Transform your photos into magical memories</p>
        </motion.div>

        <div className="services-grid">
          {services.map((service, index) => (
            <motion.div
              key={service.title}
              className="service-card"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
            >
              <div className="service-content">
                <div className="service-title">
                  <span className="service-icon">{service.icon}</span>
                  <h3>{service.title}</h3>
                </div>
                <p className="service-description">{service.description}</p>
                <div className="best-photos">
                  <h4>Best Photos For This Service:</h4>
                  <ul>
                    {service.features.map((feature) => (
                      <li key={feature}>
                        <span className="check-icon">âœ“</span>
                        {feature}
                      </li>
                    ))}
                  </ul>
                </div>
                <div className="service-price">
                  <div className="price-tag">
                    <span className="amount">{service.price}</span>
                    <span className="label">{service.priceLabel}</span>
                  </div>
                  <button className="order-button">Order Now</button>
                </div>
              </div>
            </motion.div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Services;
